#define TRIM_REGISTER4 0x06 // adress for trim register 4 (WRITE only)
// |  7  |  6  |  5  |  4  |  3  |  2  |  1  |  0  |
// |       RFU |             CLK TRIM              |
#define TRIM_REGISTER5 0x07 // adress for trim register 5 (WRITE only)
// |  7  |  6  |  5  |  4  |  3  |  2  |  1  |  0  |
// |       RFU       |        BPA TRIM TOP         |
